import React from 'react'
import "./welcome.css"
import {FaGoogle, FaFacebookF} from "react-icons/fa"
import { useNavigate } from 'react-router-dom'
 
 
 const Welcome = () => {
    const NAv=useNavigate()
   
    const handleanch=()=>{
           NAv("/Login")
    }
 
    const handleswe =()=>{
      NAv("/SignUp")
    }
